    data: |
      SELECT ALL + ( - cor0.col1 ) + + col1 + + ( + ( col2 ) ) / ( ( cor0.col2 ) + ( col0 ) ) AS col0 FROM tab2 (FORMAT parquet) AS cor0;
  - name: tab2

outputs:
  - name: q5965.out
    data: |
      0
      0
      0
